        // Set InfoWindow to fit on each municipality
        for (let i = 0; i < opstina.length; i++) {            
            opstina[i].setMap(map);
            opstina[i].setOptions({
                fillColor: "#7647b7",
                fillOpacity: 1,
                strokeWeight: 1,
                strokeColor: "white",
                strokeOpacity: 0.8
            });
            
            // Create infowindow,added Content comes from the polygons themselfs
            let infowindow = new google.maps.InfoWindow({
                content: opstina[i].name,
                position: opstina[i].my_getBounds().getCenter()
            });
            //
            google.maps.event.addListener(opstina[i], "mouseover", function(event) {
                infowindow.open(map, opstina[i]);
                this.setOptions({ fillColor: '#4b1c8c' })
            });
            google.maps.event.addListener(opstina[i], "click", function(event) {
                let municipalityInfo = `
                    <section class="fragment">
                        <div id="municipality_Info">
                            <h2 id="municipality_name">: ${this.name}</h2>
                            <h5 id="population"> : ${this.population}</h5>
                            <h5 id="women">  : ${this.women}</h5>
                            <h4 id="gynecologists">  : ${this.gynecologists > 0 ? this.gynecologists  : 
                                0}</h4>
                            ${this.gynecologists > 0 ? imaGinekolog : nemaGinekolog}
                            ${this.gynecologists > 0 ? makeFirstApp : chooseNextMunicipality}                            
                        </div>
                    </section>
                `;
                $('#gameContent').show();
                $('#gameContent').text("");
                $(municipalityInfo).hide().appendTo("#gameContent").fadeIn(2000);
                $('body, html').animate({ scrollTop: $(".fragment").last().offset().top }, 1000);

                $("#gameContent").removeClass("hide");
                if(municipalityChosen === false)
                    $("#addressModal").modal("show");
                
                $("#addressBtn").off("click");
                $("#addressBtn").on("click", () => {
                    if(municipalityChosen === false){
                    geocodeAddress(geocoder, map, opstina[i]);
                    // hospitals.sort(compare);
                    }
                });     
            });
            google.maps.event.addListener(opstina[i], "mouseout", function(event) {
                this.setOptions({ fillColor: '#7647b7' })
                infowindow.close(map, opstina[i]);
            });
        }
        $('#startGame').toggle('hide');
        $("#mapTitle").toggle("hide");
